import React from "react";
import { Route, Switch } from "react-router-dom";

import Index        from '../view/home/Home'
import Sobre        from "../view/sobre/Sobre";
import Noticias     from "../view/noticias/Noticias";
import Eventos      from "../view/eventos/Eventos"; 
import Contato      from "../view/contato/Fale";
import Denuncie     from "../view/denuncie/Denuncie";


export default function Routes() {
  return (
    <Switch>
      <Route exact path='/'             component={Index}/>
      <Route exact path='/sobre'        component={Sobre}/>
      <Route exact path='/noticias'     component={Noticias}/>
      <Route exact path='/eventos'      component={Eventos}/>
      <Route exact path='/contato'      component={Contato}/>
      <Route exact path='/denuncie'     component={Denuncie}/>
    </Switch>
  )
}
